// Navigation.js
import React, { useState } from 'react';
import './Navigation.css';

function Navigation() {
  const [dropdownOpen, setDropdownOpen] = useState(false);

  return (
    <nav className="navbar">
      <a href="/" className="navbar-brand">selfDev</a>

      <ul className="nav-links">
        <li className="nav-item"><a href="/">Home</a></li>
        <li className="nav-item"><a href="/link">Link</a></li>
        <li 
          className="nav-item dropdown" 
          onMouseEnter={() => setDropdownOpen(true)} 
          onMouseLeave={() => setDropdownOpen(false)}
        >
          <a href="#" className="dropdown-toggle">Dropdown</a>
          {dropdownOpen && (
            <div className="dropdown-menu">
              <a href="/action">Action</a>
              <a href="/another-action">Another action</a>
              <div className="dropdown-divider"></div>
              <a href="/something-else">Something else here</a>
            </div>
          )}
        </li>
        <li className="nav-item"><a href="#" className="disabled">Disabled</a></li>
      </ul>

      <form className="search-form">
        <input type="search" placeholder="Search" />
        <button type="submit">Search</button>
      </form>
    </nav>
  );
}

export default Navigation;
